import React from 'react'
import Table from 'react-bootstrap/Table';

export const PatientsTable = ({patients}) => {

    const PatientRow = (patient,index) => {

        return(
              <tr key = {index} className='even'>
                  <td> {index + 1} </td>
                  <td>{patient.name}</td>
                  <td>{patient.symptoms}</td>
              </tr>
          )
      }
      const PatientTable = patients.map((cust,index) => PatientRow(cust,index))
      const tableHeader = <thead className='bgvi'>
                            <tr>
                                <th>#</th>
                                <th>Patient Name</th>
                                <th>Symptoms</th>
                            </tr>
                        </thead>

    return (
        <Table striped bordered hover>
            {tableHeader}
            <tbody>
                {PatientTable}
            </tbody>
        </Table>
    )
}
